// App.js 
import React from "react"; 
import { 
	Navbar, 
	Nav, 
	NavDropdown, 
} from "react-bootstrap"; 
import "./App.css"; 
const navBarData = [ 
	{ 
		label: "Home", 
		url: "/", 
	}, 
	{ 
		label: "Tutorials", 
		submenu: [ 
			{ 
				label: "React", 
				url: "/react", 
				submenu: [ 
					{ 
						label: "Hooks", 
						url: "/react/hooks", 
					}, 
					{ 
						label: "Context", 
						url: "/react/context", 
						submenu: [ 
							{ 
								label: "Advanced Context", 
								url: "/react/context/advanced", 
							}, 
							{ 
								label: "Redux", 
								url: "/react/context/redux", 
							}, 
						], 
					}, 
					{ 
						label: "Router", 
						url: "/react/router", 
						submenu: [ 
							{ 
								label: "Nested Routes", 
								url: "/react/router/nested", 
							},],},],}, 
			{ 
				label: "JavaScript", 
				url: "/javascript", 
			}, 
		], 
	}, 
	{ 
		label: "About", 
		url: "/about", 
	}, 
]; 
function App() { 
	const menuShow = (mItems) => { 
		return mItems.map( 
			(item, index) => { 
				if (item.submenu) { 
					return ( 
						<NavDropdown 
							title={ 
								item.label 
							} 
							key={index} 
							className="dropdown-menu-dark 
									dropend"> 
							{menuShow( 
								item.submenu 
							)} 
						</NavDropdown> 
					); 
				} else { 
					return ( 
						<Nav.Link 
							href={ 
								item.url 
							} 
							key={index}> 
							{item.label} 
						</Nav.Link> 
					);}});}; 
	const navStyle = { 
		color: "black", 
		fontWeight: "bold", 
	}; 
	return ( 
		<Navbar expand="lg"> 
			<Navbar.Brand href="#home"> 
				<h1 
					style={{ 
						color: "white", 
					}}> 
					<b>GeeksforGeeks</b> 
				</h1> 
			</Navbar.Brand> 
			<Navbar.Toggle aria-controls="basic-navbar-nav"/> 
			<Navbar.Collapse id="basic-navbar-nav"> 
				<Nav 
					className="mr-auto"
					style={navStyle}> 
					{menuShow( 
						navBarData 
					)} 
				</Nav> 
			</Navbar.Collapse> 
		</Navbar> 
	); 
} 
export default App;
